import React, { useState } from 'react';

function Form(){
    const submit =() =>{
        console.log("submit");
    }
    const taketoreport = () =>{
        window.location.href="/report";
    }
    return(
        <div class="page3">
		<button onClick={taketoreport}><img class="page3-1" src="icon/Vector.png"  alt="noimage"/></button>
		<div class="page3-2">
			<p class="page3-2-1">Report violation </p>
			<form action="/form">
				<label for="picture" class="upload">Upload Picture</label><br/>
				<input type="image" class="img" src="icon/Group 7.png"  name="picture"/>
				<div class="after-upload"><button class="reupload" type="button" onclick="uploadagain()">Reupload</button>
				<img id="upload-img" src="icon/VES_Awards_89_cropped 1.png"  alt="noimage"/></div>
				<hr class="line"/>
				<label for="Add" class="page3-2-2">Address</label><br/>
				<input type="text" class="add page3-2-2-2"  name="add" /><br/>

				<label for="City" class="page3-2-2">City</label>
				<label for="State" class="page3-2-2-1">State</label>
				<label for="Pin" class="page3-2-2-1">Pin</label><br/>
				<input type="text" class="City page3-2-2-2" name="City"/>
				<input type="text" class="State page3-2-2-2" name="State" />
				<input type="number" class="pin page3-2-2-2" name="Pin"/><br/>

				<label for="Cont" class="page3-2-2">Contact Number</label><br/>
				<input type="number" class="add page3-2-2-2" name="Cont" /><br/>

				<label for="Title" class="page3-2-2">Title</label><br/>
				<input type="text" class="add page3-2-2-2" name="Title" /><br/>

				<label for="Details" class="page3-2-2">Details</label><br/>
				<input type="text" class="Details page3-2-2-2" name="Details" /><br/>

				<input type="button" class="submit" value="Submit" onClick={submit}/>
		</form> 


		</div>

	</div> 
    );
}

export default Form;
